import React from "react";

function Welcome() {
    return (
    <div className ="welcome">
        <div class = "row">
            <div class = "col">
                <div class = "left-side">

                </div>
            </div>
            <div class = "col">
                <div class = "right-side">
                    <img src="greenback.png" alt="Kiwi standing on oval"/>
                </div>
            </div>
        </div>
    </div>
    );
}

export default Welcome;
